import { NavLink } from "react-router-dom";
const Login = () => {
  return (
    <>
      <h1>Login form</h1>
      <NavLink to="/hr/dashboard">MaxHr</NavLink>
      <NavLink to="/manager/dashboard">Manager</NavLink>
    </>
  );
};

export default Login;
